                'ips_identitas' => '<br><table class="table table-bordered"><tbody><tr><td width="75">Nama :</td><td width="300">SESUAI PS</td></tr><tr><td>Usia&nbsp; :&nbsp; <br></td><td>40 tahun</td></tr><tr><td>Jenis kelamin&nbsp; :&nbsp; <br></td><td>Laki-laki</td></tr><tr><td>Pekerjaan&nbsp; : <br></td><td>&nbsp;Wiraswasta</td></tr><tr><td>Status pernikahan :&nbsp; <br></td><td>&nbsp;Menikah</td></tr><tr><td>Pendidikan terakhir :&nbsp;&nbsp;&nbsp; <br></td><td>S1</td></tr><tr><td>Alamat&nbsp; : <br></td><td>Cirebon</td></tr></tbody></table><p><br></p>',
                'ips_rp_sekarang' => '<table class="table table-bordered"><tbody><tr><td width="75">Keluhan Utama : </td><td width="300">  Kepala pusing</td></tr>
<tr><td>Sejak kapan/onset : </td><td>  ±2 jam yang lalu</td></tr>
<tr><td>Lokasi: </td><td>   Seluruh kepala</td></tr>
