<tr><td>Karakteristik   : </td><td>Pusing dirasakan tiba-tiba ketika pasien bangun tidur. Pasien merasa lingkungannya berputar terhadap dirinya. Mual tetapi tidak muntah. Keluhan telinga berdenging (+) Tidak ada keluhan tuli, nyeri telinga, maupun rasa penuh di telinga atau wajah. Tidak ada keluhan demam. Tidak ada keluhan pandangan ganda, nyeri kepala, kejang, kelemahan anggota gerak, maupun rasa baal di wajah, seputar mulut, maupun di anggota gerak.</td></tr>
<tr><td>Progresi  : </td><td> Keluhan pusing berputar dirasakan sangat hebat sehingga pasien takut jatuh.</td></tr>
<tr><td>Skala nyeri (bila perlu) :</td><td> </td></tr>    
<tr><td>Yang memperparah   : </td><td>Bertambah parah bila pasien menolehkan wajah atau saat merubah posisi tubuh dari tidur ke duduk dan sebaliknya</td></tr>
<tr><td>Yang mengurangi  : </td><td> Pusing dirasakan berkurang bila pasien menutup mata</td></tr>
<tr><td>Usaha yang dilakukan    : </td><td></td></tr>
<tr><td>Obat dipakai saat ini  : </td><td> Saat ini pasien tidak sedang mengkonsumsi obat apapun.</td></tr></tbody></table>',
                'ips_rp_dahulu' => '<table class="table table-bordered"><tbody><tr><td width="75">penyakit relevan   </td><td width="300"> 1 tahun yang lalu pasien pernah menderita penyakit telinga keluar cairan dan tidak obati dan sembuh sendiri. Pasien pernah mengalami hal serupa 2 bulan yang lalu, sifat serangan serupa, berlangsung singkat, dan bisa sembuh sendiri tanpa obat. Pasien menyangkal adanya riwayat kencing manis, darah tinggi, kolesterol tinggi, dan asam urat tinggi. Tidak didapatkan riwayat stroke. Tidak didapatkan riwayat trauma kepala, leher maupun wajah.</td></tr>
<tr><td>tindakan bedah/terapi lain   </td><td> Disangkal</td></tr></tbody></table><p><br></p>',
                'ips_rp_keluarga' => '<p><br></p><table class="table table-bordered"><tbody><tr><td width="75">Riwayat keluhan serupa di keluarga :</td><td width="300">disangkal</td></tr></tbody></table><br>',
                'ips_r_pribadi' => '<table class="table table-bordered"><tbody><tr><td width="75">Alkohol  :</td><td width="300">  Disangkal</td></tr>
