                'kategori_sistem_tubuh' => '1',
                'ipu_skenario_klinik' => '<p>Seorang laki-laki berusia 40 tahun datang ke Puskesmas dengan keluhan kepala pusing <br></p>',
                'ipu_peserta_tugas' => '<ol><li>Lakukan anamnesis pada pasien!<br></li><li>Lakukan pemeriksaan fisik pada pasien! <br></li><li>Usulkan pemeriksaan penunjang dan lakukan interpretasi hasil dan sampaikan kepada penguji!<br></li><li>Tentukan diagnosis kerja dan 2 diagnosis banding, tuliskan pada lembar diagnosis dan serahkan pada penguji!<br></li><li>Berikan tatalaksana farmakoterapi, tuliskan resep, serahkan pada penguji!<br></li><li>Sampaikan komunikasi dan edukasi kepada pasien !<br><br></li></ol>',
            'ip_instruksi_umum' => '<ol><li>Pastikan identitas peserta ujian pada kartu ujian sesuai dengan identitas pada komputer!<br></li><li>Tulislah 5 digit terakhir dari nomor peserta ujian pada lembar nilai tulis!<br></li><li>Amatilah dan berilah skor (0/1/2/3) atas tugas yang dikerjakan peserta ujian serta skor Global Rating sesuai rubrik penilaian pada lembar nilai tulis dan komputer!<br></li><li>Hindarilah interupsi dan/atau tindakan selain dari pada yang diminta dalam instruksi penguji!<br></li><li>Berikan informasi/hasil yang dibutuhkan secara lisan/tulisan hanya apabila peserta ujian telah melakukan dan/atau mengusulkan jenis pemeriksaan yang dimaksud (perhatikan instruksi khusus)!<br></li><li>Taatilah peraturan serta etika penguji selama menjalankan tugas sebagai penguji UK OSCE!<br><br></li></ol>',
            'ip_ik_anamnesis' => '<p>Penguji menilai anamnesis yang dilakukan peserta ujian</p><ol><li><b>Keluhan utama :</b> Kepala pusing<br></li><li><b>Perjalanan penyakit :</b> Kepala pusing sejak ±2 jam yang lalu, lokasi diseluruh kepala. Setiap serangan pusing berlangsung kurang dari 5 menit. Pusing dirasakan tiba-tiba ketika pasien bangun tidur. Pasien merasa lingkungannya berputar terhadap dirinya.<br></li><li><b>Yang memperberat : </b>Bertambah parah bila pasien menolehkan wajah atau saat merubah posisi tubuh dari tidur ke duduk dan sebaliknya.<br></li><li><b>Yang memperingan : </b>Pusing dirasakan berkurang bila pasien menutup mata<br></li><li><b>Keluhan lainnya :</b> Mual (+) Keluhan telinga berdenging (+)<br></li><li><b>RPD dan atau Riw social :</b> 1 tahun yang lalu pasien pernah menderita penyakit telinga keluar cairan dan tidak obati dan sembuh sendiri. Pasien pernah mengalami hal serupa 2 bulan yang lalu, sifat serangan serupa, berlangsung singkat, dan bisa sembuh sendiri tanpa obat. Akhir-akhir ini pasien sering kurang tidur karena harus lembur bekerja.<br><br></li></ol>',
            'ip_ik_p_fisik' => '<p>Penguji menilai pemeriksaan fisik yang dilakukan oleh peserta ujian</p><p><b>Hasil Pemeriksaan Fisik</b><br>KU: Sakit sedang<br>Tanda Vital: <br>TD: 130/80&nbsp; mmHg; <br>N:84x /menit; <br>R: 20x /menit; <br>T:36,5 OC <br>Skala nyeri : tidak ada<br></p><p><b>Status Generalisata </b><br><b>(Bila peserta ujian menanyakan hasil pemeriksaan di bawah ini, penguji menyampaikan hasil pada peserta)</b><br></p><ul><li>Kepala : normocephal, distribusi rambut merata. Konjungtiva pucat (-/-) SI (-/-)<br></li><li>THT : dalam batas normal<br></li><li>Leher : pembesaran KGB (-)<br></li><li>Thorax : dalam batas normal<br></li><li>Abdomen : dalam batas normal</li><li>Eketremitas : akral hangat, edema (-/-/-/-) crt &lt;2’’</li></ul><b>STATUS NEUROLOGIS :<br>(Penguji memberikan hasil pemeriksaan setelah peserta ujian melakukan pemeriksaan fisik yang relevan dibawah ini)<br>Kesadaran: </b>compos mentis, GCS : 15, E4V5M6<b><br>N. III dan IV, VI : </b>Nystagmus (+) horizontal&nbsp;<b><br><br></b><p><b>PEMERIKSAAN KHUSUS : <br>•&nbsp;&nbsp;&nbsp; Pemeriksaan Dix - Hallpike`s test : (+)<br>•&nbsp;&nbsp;&nbsp; Pemeriksaan Koordinasi: Tes Romberg (+)<br><br></b></p><p></p>',
                'ip_ik_ttv' => '<p> ini ttv</p>',
                'ip_ik_p_penunjang' => '<p><b>Laboratorium :</b><br>•&nbsp;&nbsp;&nbsp; Hb :13 g/dl<br>•&nbsp;&nbsp;&nbsp; Hct: 39%<br>•&nbsp;&nbsp;&nbsp; Leukosit: 8,1. 103/µl<br>•&nbsp;&nbsp;&nbsp; Trombosit: 227. 103/µl<br><b>Intepretasi : normal</b><br></p><p><b>Pemeriksaan CT Scan Kepala</b><br>Hasil pemeriksaan : <b>tidak tampak lesi hipodens ataupun hiperdens </b><br><b>Kesan : dalam batas normal</b><br><img style="width: 568px;" src="data:image/png;base64," data-filename="image002.png"><br></p>',
                'file_pp' => NULL,
            'ip_ik_diagnosis' => '<p>Penguji menilai diagnosis dan dua (2) diagnosis banding yang ditegakkan oleh peserta ujian!</p><p><b>Diagnosis: BPPV (Benign Paroxismal Positional Vertigo)</b><br>Diagnosis Banding 1: Neuritis vestibuler<br>Diagnosis Banding 2: Meniere`s disease<br><br></p>',
            'ip_ik_non_farmakoterapi' => '<p>Penguji menilai tatalaksana <b>Non farmakoterapi </b>yang dilakukan oleh peserta ujian!</p><p><b>Non Farmakoterapi :</b><br></p><ul><li>Epley Maneuver<br></li><li>Pasien dilakukan latihan vestibular (vestibular exercise) dengan metode brandDaroff.<br></li><li>Pasien duduk tegak di pinggir tempat tidur dengan kedua tungkai tergantung, dengan kedua mata tertutup baringkan tubuh dengan cepat ke salah satu sisi, pertahankan selama 30 detik. Setelah itu duduk kembali. Setelah 30 detik, baringkan dengan cepat ke sisi lain. Pertahankan selama 30 detik, lalu duduk kembali. Lakukan latihan ini 3 kali pada pagi, siang dan malam hari masing-masing diulang 5 kali serta dilakukan selama 2 minggu atau 3 minggu dengan latihan pagi dan sore hari</li></ul><p><br><img style="width: 269px;" src="data:image/gif;base64," data-filename="image004.gif"></p><p><img style="width: 25%;" src="data:image/png;base64," data-filename="image005.png"><br></p>',
                'ip_ik_farmakoterapi' => '<p>Penguji menilai tatalaksana farmakoterapi berupa resep yang dituliskan oleh peserta ujian</p><p><b>Farmakoterapi :</b><br>•&nbsp;&nbsp;&nbsp; Betahistin tablet 3x6 mg, per oral DAN<br>•&nbsp;&nbsp;&nbsp; Flunarizin tab 2x5 mg DAN<br>•&nbsp;&nbsp;&nbsp; Domperidon 10 mg 3x1 tab atau Ondansetron 2 x 2mg <br></p><p><b><br></b></p><p><b>Penulisan resep :</b><br>R/ Betahistin tab&nbsp; 6 mg No X<br>&nbsp;&nbsp;&nbsp;&nbsp; S 3 dd 1 tab PC<br><br>DAN<br><br>R/ Ondansetron tab 2 mg No X<br>&nbsp;&nbsp;&nbsp;&nbsp; S 2 dd 1 tab PC<br>&nbsp;&nbsp; &nbsp;<br>ATAU<br><br>R/ Domperidon tab 10 mg No X<br>&nbsp;&nbsp;&nbsp;&nbsp; S 3 dd 1 tab PC<br><br>DAN <br><br>R/ Flunarizine tab 5 mg No X<br>&nbsp;&nbsp;&nbsp;&nbsp; S 2 dd 1 tab PC<br>&nbsp;&nbsp; &nbsp;<br><br><br><br><br>Pro : Tn. X<br>Usia : 40 Tahun<br>Alamat : Cirebon<br><br></p>',
            'ip_ik_kom_edu' => 'Penguji menilai komunikasi dan edukasi yang disampaikan peserta ujian kepada pasien.<ol><li>Penjelasan mengenai penyakit<br></li><li>Penjelasan mengenai tatacara minum obat<br></li><li>Penjelasan mengenai pencegahan : Hindari mengubah posisi kepala secara mendadak dan jangan menolehkan kepala pada satu sisi dengan terlalu lama. Lakukan latihan rutin untuk BPPV (manuver epley). Lakukan olahraga rutin, minimal 30 menit setiap hari. Terapkan pola hidup sehat, serta istirahat dan tidur yang cukup. Hindari factor pencetus : kurang tidur<br><br></li></ol>',
